import apiClient from "./api-client";
export interface User {
	id: number;
	name: string;
}
const userServies = () => {
	const userServies = () => {
		const controller = new AbortController();
		apiClient.get<User>("/users", { signal: controller.signal });
	};
};

export default userServies;
